import React from "react";

const Pagination = ({ pageNumber, setPageNumber }) => {
  const prev = () => {
    if (pageNumber === 1) return;
    setPageNumber((page) => page - 1);
  };
  const next = () => {
    setPageNumber((page) => page + 1);
  };

  return (
    <div>
      <button onClick={prev}>Prev</button>
      <button onClick={next}>Next</button>
    </div>
  );
};

export default Pagination;
